import React, { Component } from 'react';

const Titre = ({ bgcolor, color, width, height }) => (
  <h1
    className='p-2 ml-5 pl-3'
    style={{
      backgroundColor: bgcolor,
      color: color,
      width: width,
      height: height
    }}
  >
    Photos
  </h1>
);

const Photo1 = ({ position, width, height, top, left }) => (
  <a href='https://www.instagram.com/p/B6F82NSlKSH/'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/12.jpg')}
      alt='galeriePhoto1'
    />
  </a>
);

const Photo2 = ({ position, width, height, top, left }) => (
  <a href='https://www.instagram.com/p/B6F82NSlKSH/'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/13.jpg')}
      alt='galeriePhoto1'
    />
  </a>
);
const Photo3 = ({ position, width, height, top, left }) => (
  <a href='https://www.instagram.com/p/B6F82NSlKSH/'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/14.jpg')}
      alt='galeriePhoto1'
    />
  </a>
);

const Photo4 = ({ position, width, height, top, left }) => (
  <a href='https://www.instagram.com/p/B6F82NSlKSH/'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/16.jpg')}
      alt='galeriePhoto1'
    />
  </a>
);

const Photo5 = ({ position, width, height, top, left }) => (
  <a href='https://www.instagram.com/p/B6F82NSlKSH/'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/4.jpg')}
      alt='galeriePhoto1'
    />
  </a>
);

const Photo6 = ({ position, width, height, top, left }) => (
  <a href='https://www.instagram.com/p/B6F82NSlKSH/'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/17.jpg')}
      alt='galeriePhoto1'
    />
  </a>
);

export class Photos extends Component {
  render() {
    return (
      <div style={{ marginTop: '100px' }}>
        <Titre bgcolor='rgba(255,255,255,0.1)' color='white' width='400px' />
        <div
          className='d-flex justify-content-around'
          style={{ width: '100%' }}
        >
          <Photo1 height='365px' position='relative' top='30px' />
          <Photo2 height='365px' position='relative' top='30px' />
          <Photo3 height='365px' position='relative' top='30px' />
        </div>
        <div
          className='d-flex justify-content-around'
          style={{ width: '100%' }}
        >
          <Photo4 height='365px' position='relative' top='100px' />
          <Photo5 height='365px' position='relative' top='100px' />
          <Photo6 height='365px' position='relative' top='100px' />
        </div>
      </div>
    );
  }
}

export default Photos;
